soup = BeautifulSoup(html_data, 'html.parser')

# Find all rows with class 'markRed'
rows = soup.find_all('tr', class_='markRed')

# Open a CSV file in write mode
with open('output.csv', mode='w', newline='') as file:
    writer = csv.writer(file)

    # Write the header row
    writer.writerow(['ID', 'English Text', 'Translated Text'])

    # Iterate over each row and extract necessary data
    for row in rows:
        # Find checkbox value
        checkbox_value = row.find('input', class_='translation_checkbox')['value']
        
        # Find English text
        english_text = row.find_all('td')[1].get_text()
        
        # Find translated text
        translated_text = row.find('td', id=f'trans_{checkbox_value}').get_text()
        
        # Write the data to CSV
        writer.writerow([checkbox_value, english_text, translated_text])

print("CSV file generated successfully.")
